import React from "react";
import "./SubSection.css"

import Q from '../../media/TripPicMedia/AffinityDiagram.png';
// import AffinityDiagram from '../../media/TripPicMedia/AffinityDiagram.png';
// import CustomerJourneyMap from './TripPicMedia/CustomerJourneyMap.png';
// import UserFlow from './TripPicMedia/UserFlow.png'
// import Crazy8s from './TripPicMedia/Crazy8s.png'
// import SpeedDating from './TripPicMedia/SpeedDating.png'
// import ConceptModel from './TripPicMedia/ConceptModel.png'
// import Wireframes from './TripPicMedia/Wireframes.png'

/*  SubSection is a component that consistently styles header, text, and images within a section 
    used in Section of the detail view of each Project
*/

function SubSection(props) {
    return (
        <div className="subsection">
            {
                props.header === undefined 
                ?   <></>
                :   <div>
                        <h3>{ props.header }</h3>
                        <br></br>
                    </div>           
            }
            {
                props.body === undefined 
                ? <></>
                :   <div>
                        <p>{ props.body }</p>
                        <br></br>
                    </div>  
            }
            {
                props.img === undefined 
                ? <></>
                : <img src={ props.img }></img>
            }
        </div>
    );
}
export default SubSection;
